f. \u0427\u0442\u043e\u0431\u044b \u0432\u044b\u0436\u0438\u0442\u044c, \u043e\u043d\u0438 \u0431\u044b\u043b\u0438 \u0432\u044b\u043d\u0443\u0436\u0434\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%BD%D0%B8%D0%B1%D0%B0%D0%BB%D0%B8%D0%B7%D0%BC\" title=\"\u041a\u0430\u043d\u043d\u0438\u0431\u0430\u043b\u0438\u0437\u043c\">\u0435\u0441\u0442\u044c \u0442\u0435\u043b\u0430 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-154_%D0%BF%D0%BE%D0%B4_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-154 \u043f\u043e\u0434 \u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u043e\u043c\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-154 \u043f\u043e\u0434 \u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u043e\u043c<\/a>, 110 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986_%D0%B3%D0%BE%D0%B4\" title=\"1986 \u0433\u043e\u0434\">1986<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0443<\/a> \u0438\u0437 \u0441\u0435\u043c\u0438\u043b\u0435\u0442\u043d\u0435\u0439 \u0433\u043e\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%81%D1%8B%D0%BB%D0%BA%D0%B0_(%D0%BD%D0%B0%D0%BA%D0%B0%D0%B7%D0%B0%D0%BD%D0%B8%D0%B5)\" title=\"\u0421\u0441\u044b\u043b\u043a\u0430 (\u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u0435)\">\u0441\u0441\